import React from 'react';

const Header = () => {
    return (
        <div id="header">
            <div className="container">
                <div className="navbar">
                    <div></div>
                    <ul>
                        <li><a href="#">Курсы</a></li>
                        <li><a href="#">Преимущества</a></li>
                        <li><a href="#">Условия</a></li>
                        <li><a href="#">FAQ</a></li>
                        <li><a href="#">Контакты</a></li>
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default Header;
